import React from 'react';
import './Card.css';

const Card = ({card}) => {
    // const {card} = props;
    // console.log(card)
    const total = 0;
    for(const product of card){
        total = total+product.price;
    }
    return (
        <div className='card'>
        <h4>Order Summary</h4>
        <p>Selected Item: {card.length}</p>
        <p>Total Price: {total}</p>
        <p>Total Shipping: </p>
        <p>Tax: </p>
        <h6>Grand Total: </h6>
        </div>
    );
};

export default Card;
